  const handleExport = (row) => {
    const doc = new jsPDF();

    // Page dimensions
    const pageWidth = doc.internal.pageSize.getWidth();
    const pageHeight = doc.internal.pageSize.getHeight();

    // Add company logo
    const imgData = "data:image/png;base64,"; // Replace with your logo's Base64 string
    const logoWidth = 20;
    const logoHeight = 20;
    doc.addImage(imgData, "PNG", (pageWidth - logoWidth) / 2, 10, logoWidth, logoHeight);

    // Add title
    doc.setFont("Poppins-Medium", "normal");
    doc.setFontSize(16);
    const title = "Ad Reports";
    const titleWidth = doc.getTextWidth(title);
    doc.text(title, (pageWidth - titleWidth) / 2, 40);

    // User details
    const details = [
      ["ID", row.id],
      ["Title", row.title || "NA"],
      ["Image", row.image ? "Included Below" : "No Image Available"],
      ["Redirections", row.redirections || "NA"],
      ["Timeline", `${row.timeline || "NA"} - ${row.timeline1 || "NA"}`],
      ["Views", row.views],
      ["Active", row.active ? "Yes" : "No"],
    ];

    let y = 50;
    const lineSpacing = 10;

    details.forEach(([key, value]) => {
      doc.setFontSize(12);
      const detailText = `${key}: ${value}`;
      const textWidth = doc.getTextWidth(detailText);
      doc.text(detailText, (pageWidth - textWidth) / 2, y);
      y += lineSpacing;
    });

    // Add image if available
    if (row.image) {
      const imgWidth = 100;
      const imgHeight = 100;
      const imgX = (pageWidth - imgWidth) / 2;
      const imgY = y + 10;
      doc.addImage(row.image, "JPEG", imgX, imgY, imgWidth, imgHeight);
      y += imgHeight + 20; // Adjust y position for footer
    }

      // Add line above footer
      const footerLineY = pageHeight - 35;
      doc.setDrawColor(181, 4, 14); // Red line color
      doc.setLineWidth(0.5);
      doc.line(10, footerLineY, pageWidth - 10, footerLineY); // Line spans across the page width

      // Footer rectangle background
      const footerHeight = 30;
      const footerY = pageHeight - footerHeight;
      doc.setFillColor(255, 255, 255); // Footer background color
      doc.rect(0, footerY, pageWidth, footerHeight, "F");

      // Footer text
      const footerTextLines = [
        "SKANDHAMA, 12-13-521/3, Street No.14,",
        "Nagarjuna Nagar, Tarnaka, Hyderabad - 500017, Telangana",
        "Email: info@anitra.co",
      ];
      const footerTextX = 10; // Left-align footer text
      const footerTextY = footerY + 5;

      doc.setFont("Poppins-Regular", "normal");
      doc.setFontSize(10);
      doc.setTextColor(0, 0, 0); // Black text

      footerTextLines.forEach((line, index) => {
        doc.text(line, footerTextX, footerTextY + index * 5);
      });

    // Save the PDF
    doc.save("ad-reports.pdf");
  };

